import './App.css';

import logoLabenu from './imgs/labenu.png'

function App() {
  return (

    <div>
      <h1>Aprenda React com a Labenu!</h1>

      <img src={logoLabenu} alt="logo escrito labenu"/>

      <a href="https">Site da Labenu</a>

      <button>Clique aqui!</button>

    </div>
  );
}

export default App;
